import React, { Component } from 'react'

export default class OrderTable extends Component {

    state = {

    }
    render() {

        return (
          <div>
            <table className="table">
              <thead>
                <tr>
                  <th scope="col">Heading</th>
                </tr>
              </thead>
              <tbody>
                {projectors.map((item) => {
                  return (
                    
                      <tr key={item._id}>
                        <td>{item.proj}</td>
                        <td>
                          <button
                            onClick={() => this.handleButtonClick(item._id)}
                            type="button"
                            className="success button"
                          >
                            Select
                          </button>
                        </td>
                      </tr>
                      
                    
                  );
                })}
              </tbody>
            </table>
          </div>
        );
    }
}
